'use strict';

var faust = faust || {};

faust.error_msg = null;
faust.getErrorMessage = function() { return faust.error_msg; };

// Audio buffer size
faust.buffer_size = 128;

faust.asm2wasm = { // special asm2wasm imports
    "fmod": function(x, y) {
        return x % y;
    },
    "log10": function(x) {
        return Math.log(x) / Math.log(10);
    },
    "remainder": function(x, y) {
        return x - Math.round(x/y) * y;
    }
}

faust.importObject = { imports: { print: arg => console.log(arg) } }
faust.importObject["global.Math"] = Math;
faust.importObject["asm2wasm"] = faust.asm2wasm;

// WebAssembly instance
faust.TunedBars_instance = null;

// JSON parsing functions
faust.parse_ui = function(ui, obj, callback)
{
    for (var i = 0; i < ui.length; i++) {
        faust.parse_group(ui[i], obj, callback);
    }
}

faust.parse_group = function(group, obj, callback)
{
    if (group.items) {
        faust.parse_items(group.items, obj, callback);
    }
}

faust.parse_items = function(items, obj, callback)
{
    var i;
    for (i = 0; i < items.length; i++) {
        callback(items[i], obj, callback);
    }
}

faust.parse_item1 = function(item, obj, callback)
{
    if (item.type === "vgroup"
        || item.type === "hgroup"
        || item.type === "tgroup") {
        // TODO
        faust.parse_items(item.items, obj, callback);
    } else if (item.type === "hbargraph"
               || item.type === "vbargraph") {
        // Keep bargraph adresses
        //obj.outputs_items.push(item.address);
    } else if (item.type === "vslider"
               || item.type === "hslider"
               || item.type === "button"
               || item.type === "checkbox"
               || item.type === "nentry") {
        obj.push({ name: item.address,
                    defaultValue: item.init,
                    minValue: item.min,
                    maxValue: item.max });
    }
}

faust.parse_item2 = function(item, obj, callback)
{
    if (item.type === "vgroup"
        || item.type === "hgroup"
        || item.type === "tgroup") {
        // TODO
        faust.parse_items(item.items, obj, callback);
    } else if (item.type === "hbargraph"
               || item.type === "vbargraph") {
        // Keep bargraph adresses
        obj.outputs_items.push(item.address);
        obj.pathTable[item.address] = parseInt(item.index);
    } else if (item.type === "vslider"
               || item.type === "hslider"
               || item.type === "button"
               || item.type === "checkbox"
               || item.type === "nentry") {
        // Keep inputs adresses
        obj.inputs_items.push(item.address);
        obj.pathTable[item.address] = parseInt(item.index);
    }
}

